sources.styles/utils/mixin.scss:
@mixin onTablet {
  @media (min-width: 744px) {
    @content;
  }
}

@mixin onDesktop {
  @media (min-width: 1020px) {
    @content;
  }
}

@mixin biggerLogo {
  width: 187px;
  height: 56px;
}

@mixin topActions {
  display: flex;
  justify-content: space-between;
  align-items: center;
}

@mixin links {
  --icon--size: 18px;
  display: grid;

  @include onTablet {
    --icon--size: 24px;
  }
}

@mixin thirdTitle {
  font-weight: 700;
  font-size: 24px;
  line-height: 34px;
}

@mixin deafultParagraph {
  font-weight: 400;
  font-size: 16px;
  line-height: 22px;
}

