sources.styles/blocks/form-field.scss:
input:-webkit-autofill,
input:-webkit-autofill:hover, 
input:-webkit-autofill:focus,
textarea:-webkit-autofill,
textarea:-webkit-autofill:hover,
textarea:-webkit-autofill:focus,
select:-webkit-autofill,
select:-webkit-autofill:hover,
select:-webkit-autofill:focus {
  border: 1px solid rgb(255, 255, 255);
  -webkit-text-fill-color: rgb(17, 16, 16);
  -webkit-box-shadow: 0 0 0px 1000px #ffffff inset;
  transition: background-color 5000s ease-in-out 0s;
}

.form-field {
  box-sizing: border-box;
  display: block;
  padding: 14px 16px;
  border: 1px solid transparent;

  width: 100%;
  height: 48px;

  background: #f8f8fa;
  border-radius: 40px;
  color: $form-color-dark;

  &::placeholder {
    font-weight: 400;
    font-size: 14px;
    line-height: 20px;
    color: #7e7e83;
  }

  &:hover {
    border-color: #d5d7de;
    outline: none;

    &::placeholder {
      color: $form-color-dark;
    }
  }

  &:focus {
    border-color: $form-color-dark;
    outline: none;

    &::placeholder {
      color: $form-color-dark;
    }
  }

  &--textarea {
    height: 148px;
    resize: none;

    font-family: inherit;
    border-radius: 16px;
  }
}

sources.styles/blocks/grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  column-gap: 20px;

  @include onTablet {
    grid-template-columns: repeat($columns-ipad, 1fr);
    column-gap: 24px;
  }

  @include onDesktop {
    grid-template-columns: repeat($columns-desktop, 1fr);
  }

  &--ipad {
    display: block;

    @include onTablet {
      display: grid;
    }
  }

  &--desktop {
    display: block;

    @include onDesktop {
      display: grid;
    }
  }

  &__item {
    &--ipad {
      @include onTablet {
        @for $start from 1 through $columns-ipad {
          @for $end from $start through $columns-ipad {
            &-#{$start}-#{$end} {
              grid-column: #{$start} / #{$end + 1};
            }
          }
        }
      }
    }

    &--desktop {
      @include onDesktop {
        @for $start from 1 through $columns-desktop {
          @for $end from $start through $columns-desktop {
            &-#{$start}-#{$end} {
              grid-column: #{$start} / #{$end + 1};
            }
          }
        }
      }
    }
  }
}

sources.styles/blocks/header.scss:
.header {
  background-image: url("../images/header-hq.jpg");
  background-size: cover;
  background-position: 85%;


  font-weight: 700;

  @include onTablet {
    background-position: center;
  }

  &__content {
    box-sizing: border-box;
    display: flex;
    justify-content: space-between;
    flex-direction: column;

    margin: auto;

    width: 100%;
    height: 100vh;
    padding: 30px 0 90px;

    @include onTablet {
      padding: 34px 0 130px;
    }

    @include onDesktop {
      padding: 36px 0 200px;


    }
  }

  &__top {
    @include topActions;
  }

  &__links {
    @include links;

    grid-template-columns: var(--icon--size) var(--icon--size);
    gap: 30px;

    @include onTablet {
      gap: 40px;
    }
  }

  &__title {
    font-size: 36px;
    line-height: 100%;
    display: flex;
    align-self: center;
    letter-spacing: -1.5px;
    white-space: nowrap;

    @include onTablet {
      font-size: 64px;
    }

    @include onDesktop {
      font-size: 80px;
    }
  }
}

sources.styles/blocks/icon.scss:
.icon {
  position: relative;
  background-position: center;
  background-repeat: no-repeat;
  background-size: contain;

  width: 24px;
  height: 24px;
  padding-bottom: 100%;

  @include onTablet {
    width: 32px;
    height: 32px;
  }

  @include onDesktop {
    width: 32px;
    height: 32px;
  }

  &__tooltip {
    display: block;
    position: absolute;
    right: 100%;
    top: 50%;
    transform: translateY(-50%);
    align-self: center;

    width: max-content;
    margin-right: 12px;

    transition: opacity $transition-time;
    opacity: 0;
    pointer-events: none;

    font-size: 12px;
    color: $color-white;
    letter-spacing: 2px;
    text-transform: uppercase;
  }

  &--phone {
    background-image: url("../images/phone.svg");

    &:hover {
      @include onDesktop {
        .icon__tooltip {
          opacity: 1;
          pointer-events: all;
        }
      }
    }
  }

  &--menu {
    background-image: url("../images/menu.svg");

    &:hover {
      background-image: url("../images/menu-hover.svg");
    }
  }

  &--close {
    background-image: url("../images/close.svg");
  }
}

